import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

export default function Profile(){
  const {user} = useAuth0();

  return(
    <div>
      <h1>Profile</h1>
      <img src={user.picture} alt={user.name}/> 
       <h3>{user.name}</h3>
      <h3>{user.email}</h3>

      <pre>
        {JSON.stringify(user)}
      </pre>

    </div>
  )
}
